export const styles={
    inpSmall:{
        Maxwidth: 300,
        height: 66,
        color: "#445DFF"
    },
    inpLarge:{
        Maxwidth: 620,
        height: 66,
        color: "#445DFF"
    },
    container:{
        position: "relative"
    },
    btn:{
        color: "white",
        background: "#445DFF",
        borderRadius: 100,
        padding: "11px 36px 11px 36px",
        border: "none"
    },
    btnFont:{
        fontSize: 20,
        letterHeight: 27,
        textAlign: "center"
    }
}
